//making use icon custom hook
const useIcons = () => {
  const getIcon = (iconName: string): React.FC<IconProps> | null => {
    return icons[iconName] || null;
  };
  return { getIcon };
};

//checking if icon is found
const isIconComponent = (icon: any): icon is React.FC<IconProps> => {
  return typeof icon === "function";
};

//exporting assets
export default useIcons;
export { isIconComponent };
export type { IconProps };
